--
-- Name: swap_words(text, text, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION swap_words(name1 text, name2 text, word_index integer) RETURNS text
    LANGUAGE plpython3u
    AS $$
    words1 = name1.split()
    words2 = name2.split()
    try:
        words1[word_index] = words2[word_index] 
    except IndexError:
        return name1 
    return ' '.join(words1)
$$;


